import React from "react";

function Add(a,b){
      return(
        a+b
      );
}

function Sub(a,b){
      return(
        a-b
      );
}
function Div(a,b){
      return(
        ab
      );
}
function Mult(a,b){
      return(
        a*b
      );
}
export default Add;
